SELECT tblImp_Excel_0_Spez.ID, tblImp_Excel_0_Spez.Importspez, tblImp_Excel_1_Kopf.Importname, tblImp_Excel_1_Kopf.ID AS Imp_ID, tblImp_Excel_2_Feldamen.Feldname, tblImp_Excel_2_Feldamen.IstID, tblImp_Excel_3_Feldinhalt.Anzahl, tblImp_Excel_3_Feldinhalt.Fe_Spalte, tblImp_Excel_3_Feldinhalt.Fe_Spalte_Nr, tblImp_Excel_3_Feldinhalt.Fe_Zeile, tblImp_Excel_3_Feldinhalt.Fe_Typ_org, tbl_Textbaustein_Typen.Beschreibung, tblImp_Excel_3_Feldinhalt.Fe_Typ_tmp, tbl_Textbaustein_Typen_1.Beschreibung
FROM (((tblImp_Excel_3_Feldinhalt INNER JOIN (tblImp_Excel_2_Feldamen INNER JOIN tblImp_Excel_1_Kopf ON tblImp_Excel_2_Feldamen.Kopf_ID = tblImp_Excel_1_Kopf.ID) ON tblImp_Excel_3_Feldinhalt.Feld_ID = tblImp_Excel_2_Feldamen.ID) INNER JOIN tbl_Textbaustein_Typen ON tblImp_Excel_3_Feldinhalt.[Fe_Typ_org] = tbl_Textbaustein_Typen.Feldtyp) INNER JOIN tblImp_Excel_0_Spez ON (tblImp_Excel_1_Kopf.Kopf_ID = tblImp_Excel_0_Spez.ID) AND (tblImp_Excel_1_Kopf.Kopf_ID = tblImp_Excel_0_Spez.ID)) INNER JOIN tbl_Textbaustein_Typen AS tbl_Textbaustein_Typen_1 ON tblImp_Excel_3_Feldinhalt.Fe_Typ_tmp = tbl_Textbaustein_Typen_1.Feldtyp
ORDER BY tblImp_Excel_1_Kopf.Importname, tblImp_Excel_2_Feldamen.ID;
